    return (
        <Box 
            margin={1}
            border={1}
            height={'100vh'}
            alignItems={'center'}
            justifyContent={'center'}
        >
            <Box
            margin={1}
            border={1}
            alignItems={'center'}
            justifyContent={'center'}
            >
                <SearchBar />
            </Box>

        </Box>

    )
}
